import './SearchBar.css';

class SearchBar extends React.Component {
  render() {
    return(
      <div class="search">
        <input type="text" class="searchTerm" placeholder="Which movie are you looking for ?"/>
        <button type="submit" class="searchButton" placeholder="Yo"/>
      </div>
    )
  }
}

export default SearchBar
